import {FaBars, FaTimes} from "react-icons/fa"

function Navbar() {
    return (
        <header>
            <h3>Logo</h3>
            <nav>
                <a href="/#">Home</a>
                <a href="/#">My work</a>
                <a href="/#">Blog</a>
                <a href="/#">About me</a>
                <button>
                    <FaTimes />
                </button>
            </nav> 
            
        </header>
    );
}

export default Navbar;
